import { useDispatch } from 'react-redux';
import './Button.scss';
import { setTasks } from '../../../pages/App/action';

export const CtButton = ({ data }) => {
    const dispatch = useDispatch();
    const handeClick = () => {
        dispatch(setTasks("Learn the basics with the easy-to-follow Getting Started Guide ðŸ”—"))
    }

    return (
        <div className="ct__button prefixIcon cursor-pointer" onClick={handeClick}>
            <div className='left'>
                {data.prefixIcon}
                {data.description}
            </div>
            <div className="right">
                {data.suffixIcon}
            </div>
        </div>
    );
}
